import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./Navbar.js";
import MainBody from "./MainBody.js";
import IntroText from "./IntroText.js";
import RightImagetext from "./RightImagetext.js";
import LeftImageText from "./LeftImageText.js";

function App() {
  return (
    <div id="page-wraper">
      <Router>
        <Switch>
          <Route exact path="/" component={(Navbar, MainBody)} />
          <Route path="/home" component={IntroText} />
          <Route path="/features" component={RightImagetext} />
          <Route path="*">Error 404 :Not Found</Route>
        </Switch>
      </Router>

      <MainBody />
    </div>
  );
}

export default App;
